// src/EmailIcon.js
import React from 'react';

const EmailIcon = () => (
  <a href="mailto:your.email@example.com" target="_blank" rel="noopener noreferrer" className="footer-link">
    <i className="fas fa-envelope"></i>
    <span>Email</span>
  </a>
);

export default EmailIcon;
